(29, 1, 'About dreamajax', '<p>Welcome to <strong>Dreamajax Technologies</strong> &ndash; a leading provider of Ads serving platform for Ads serving industries. We strive to deliver quality solutions by using technology and our vast experience. We offer services like web application development; ads server implementation; e-commerce design; open source customization; content management system; template based web design; maintenance and support.</p> 						<p>Dreamajax Technologies is a web application development company, serving all over the globe. It&rsquo;s our efficient and effective solution that has given us global giants as satisfied clients. Dreamajax has earned a strong reputation in Ads serving platform as a dependable source for all advertisers. We have catered to over 300 Clients belonging to various business domains.</p> 						<p>As a web development company we have been redefining the standards for website designing and web application development with utmost consistency. Dreamajax Technologies with its rich experience in web application development, offers a wide range of services to fulfill its client&rsquo;s business needs for the web, in terms of creating stunning web applications and user friendly web application development.</p> 						<p>With all its profound achievements reflected in its growth at warp speed, Dreamajax looks forward to another successful year working closely with its customers and partners to build, run and leverage solutions that help businesses&rsquo; to succeed in a rapidly changing and challenging world.</p>', 'HTML', '', '2009-07-27 01:09:10', '2009-07-27 01:09:10', '2009-07-31 00:00:00'),
