(42, 'Official Testing Classroom (1)', '<p>Hi Mr. Sawatzky,<br /><br />Thank you :). I''ve followed your instructions and have registered for<br />an account, sent in my application, and sent the activation assignment<br />to my calculus teacher, Mr. Kirkey.</p><p>Thanks,<br />Student</p>', 72, '2009-10-21 18:05:05', '2009-10-21 18:05:05'),
