INSERT INTO `experts_promo_text` (`id`, `exp_id`, `content`) VALUES
(2, 454, '<p><span style="color: rgb(255, 102, 0);"><em><strong>Am here to do something!!!&nbsp; </strong></em></span><span style="color: rgb(255, 102, 0);"><strong><br /></strong></span></p>'),
(29, 1923, '<p>I''ve been tutoring informally throughout the past few years, so this is nothing new to me. I can teach pretty much anything for the maths and sciences. </p><p>I''ll cya on the whiteboard!!</p>'),
(4, 1106, '<p>Mark Elliot &quot;Zuck&quot; Zuckerberg (born May 14, 1984) is an American entrepreneur who co-founded the social networking site Facebook. Zuckerberg co-founded Facebook with fellow classmates Dustin Moskovitz, Eduardo Saverin, and Chris Hughes while attending Harvard. He is a billionaire due to his 24% share of Facebook.</p>'),
(6, 1411, '<p>Presidential Intern</p>'),
(30, 1608, '<p style="font-size: 14px; margin-top: 20px; margin-right: 0px; margin-bottom: 5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; outline-width: 0px; outline-style: initial; outline-color: initial; vertical-align: baseline; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: transparent; line-height: 20px; color: rgb(87, 87, 87); font-family: Arial; ">Hey everyone,</p> <p style="font-size: 14px; margin-top: 20px; margin-right: 0px; margin-bottom: 5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; outline-width: 0px; outline-style: initial; outline-color: initial; vertical-align: baseline; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: transparent; line-height: 20px; color: rgb(87, 87, 87); font-family: Arial; ">I am a Sophomore, University of Toronto, student with expertise in<strong style="font-size: 14px; margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; outline-width: 0px; outline-style: initial; outline-color: initial; vertical-align: baseline; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: transparent; font-style: normal; font-weight: bold; background-position: initial initial; background-repeat: initial initial; ">:</strong></p> <p><strong>General Math<br style="font-size: 14px; " /> Prealgebra<br style="font-size: 14px; " /> Algebra<br style="font-size: 14px; " /> Calculus<br style="font-size: 14px; " /> Advanced Math</strong></p> <div>&nbsp;</div> <div><u><em>Also I do have an experience of teaching in Mathematical field to O-levels and A-levels...and I am gold medalist in this field.</em></u> <p style="font-size: 14px; margin-top: 20px; margin-right: 0px; margin-bottom: 5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; outline-width: 0px; outline-style: initial; outline-color: initial; vertical-align: baseline; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: transparent; line-height: 20px; background-position: initial initial; background-repeat: initial initial; ">If I''m online, connect with me! If not, feel free to leave me a message and I''ll get back to you asap.</p> </div>'),
(8, 1437, '<p>I am a graduate student at the London School of Economics. My service is as a private tutor. I <strong>answer questions</strong> and help you to <strong>clarify concepts</strong> you might be having trouble with.</p> <p>I send you detailed explanations in a pdf file so that you can understand and incorporate the reasoning in solving economics problems. We can then discuss the exercises via chat to clear up any issues you may have.</p> <p><span style="color: rgb(0, 102, 0);"><strong><span id="ctl00_ctl00_AbsMP_BaseMP_lblDegrees">Degrees</span></strong></span><span id="ctl00_ctl00_AbsMP_BaseMP_lblDegrees"><br /> BSc in Mathematics. Diploma in Business Intelligence.</span></p> <p><strong><span id="ctl00_ctl00_AbsMP_BaseMP_lblDegrees"><span style="color: rgb(0, 102, 0);">Experience and Qualific</span><br /> </span></strong><span id="ctl00_ctl00_AbsMP_BaseMP_lblExperience">Two    year''s   experience as a private tutor in Economics. University   Professor  in  Relational Databases and Business Intelligence.  21 years    professional  experience in Information Technology (IT).</span><strong><span id="ctl00_ctl00_AbsMP_BaseMP_lblDegrees"><br /> </span></strong></p>'),
(9, 124, '<p>I have a PhD in pure awesomeness. Don''t resist.</p>'),
(11, 0, '<p><span style="color: rgb(255, 102, 0);"><strong>Am here to do something!!!&nbsp;&nbsp; tesxt here<br />\r\n</strong></span></p>'),
(28, 1665, '<p>I have Bachelors of Mechanical Engineering from Carleton University. I graduated with almost straight A''s in Math. Math was my favorite subject and I would love to impart that knowledge onto people who need help.</p>'),
(13, 1660, '<p><strong>Success travels from failure to failure with enthusiasm.</strong> <img src="http://www.rayku.com/js/fckeditor/editor/images/smiley/msn/smile.png" alt="" /></p>'),
(14, 1662, '<p>Hi, guys, are you stressed out about math133? Do you find it hard to solve financial math problems? Don''t worry, I''m here to help you.&nbsp; </p>'),
(15, 1628, '<p>My name is Chris and I am a 2nd year Rotman Commerce student in Finance &amp; Economics. I love calculus and I would love to be able to share my knowledge and tips for succeeding in math with you.</p><p>I look forward to answering your questions!&nbsp;If I''m online, connect with me! If not, then please feel free to send me a private message for my personal contact info or for any other questions/concerns you may have and I will get back to you asap!</p><div><br />&nbsp;</div>'),
(16, 1679, '<p>I have 7 years of tutoring experience, and 2 years of TA experience. In my spare time I work as a private tutor for highschool students and first or second year engineering students.</p><p>I have completed my undergraduate degree in Engineering and any core course I can certainly cover with you.</p><p>Because I have done my undergrad at 1 university, and am now doing my MSc in Engineering (where I TA) at another I have a great undestanding for the variability (or lack there of) between schools and professors.</p><p>Any Math course up to the end of 2nd year I can cover, as well as any core engineering course (sciences required included), and ANY highschool science (Biology, Chemistry and Physics) or math course.</p>'),
(17, 1626, '<p>&nbsp;HELLO!</p> <p>Call me Sam. &nbsp;I will be working with students mostly in the Algebra 1 and Geometry range as that is what I will be teaching on the online learninghighschool. &nbsp;I will be adding algebra 2, but fro any questions with algebra 1, just send me a quick message and we will work it out! &nbsp;Hope your rayku experience is wonderful!</p> <p>Sam</p>'),
(18, 1623, '<p>&nbsp;HI, I AM STUDYING MATHEMATICS, ECONOMICS AND STATISTICS IN U OF T. AND THIS IS MY FOURTH YEAR. I HAVE TAKEN MAT 137, MAT 244, MAT 246, MAT 315 AND SOME STATISCS COURSES. I AM HAPPY TO ANSWER ALL THE RELATED QUESTIONS.</p>'),
(19, 1656, '<p>&nbsp;I am a new tutor at Rayku. I am a second year student in University of Toronto. I did very well in my first year Calculus, MAT 133. If you have any question related to my field, feel free to ask. I am right there!</p>'),
(20, 1632, '<p>I''m like your usual tutor (4.0 gpa, 90 or above in every course, etc) except my career goal isn''t something fancy like doctor or lawyer. Rather, I want to be a teacher and I have the experience and skill to back that up. It''s important that you choose a tutor who knows what he''s talking about, but it''s even better when you know what he''s talking about too. I think I have both those qualities. So choose me!</p><p>&nbsp;<img src="http://www.rayku.com/js/fckeditor/editor/images/smiley/msn/wavespin.gif" alt="" /></p>'),
(22, 1659, '<p>Hey guys, I am an eco and maths student. I&nbsp;love what I&nbsp;am doing and learning, and I will use that to help you on the way of your studies and understanding. I am an expert on the MAT133 material (I&nbsp;got a 94) and I am presently doing MAT224 and MAT235, MAT244 and MAT246 all of which are going equally well. I&nbsp;am also doing ECO227, which is basically the equivalent of STA257 and STA261, so feel free to ask any questions there too. If you want to understand and not just enter numbers into the calculator, I''m your man! </p>'),
(23, 1620, '<p>&nbsp;I am an undergraduate student at the University of Waterloo studying Mathematics and Wilfrid Laurier University studying Business Administration.&nbsp;</p><p>I have taken courses in calculus, classical algebra, linear algebra, statistics, and actuarial mathematics.</p>'),
(27, 1916, '<p>I can answer all questions from MAT135.</p>'),
(26, 1619, '<p>I am a Sophomore University of Toronto student with expertise in<strong>:</strong></p><p>General Math<br />Prealgebra<br />Algebra<br />Calculus<br />Advanced Math</p><p>Welcome to my portfolio profile. I am a new expert at Rayku so you may  not be able to see much on this page. Though, if you have a question  that''s within my field, I''m sure I can help you out!<br /><br />If I''m online, connect with me! If not, feel free to leave me a message and I''ll get back to you.</p>'),
(31, 1953, '<p>I am currently studying for my undergraduate degree in physics at the University of Toronto.<br /> <br /> I am very enthusiastic about physics and am able to communicate complex concepts at a fundamental level so they can be easily understood.<br /> <br /> If my original explanation has not allowed you to grasp the concept or idea, I will do my absolute best to think of alternate explanations until you have a full grasp on the topic.</p>'),
(32, 1989, '<p>I am working for free and am interested in helping people with math just for fun. Ask me anything and I will be honest about my skilllevel regarding the subject plus try my best to help you out.</p>'),
(33, 2000, '<div style="mso-element:para-border-div;border:none;border-top:solid windowtext 1.0pt; mso-border-top-alt:solid windowtext .5pt;padding:1.0pt 0cm 0cm 0cm;background: #C6D9F1"> <p class="MsoNormal" style="text-align:justify;text-justify:inter-ideograph; line-height:18.0pt;mso-line-height-rule:exactly;page-break-after:avoid; mso-outline-level:2;background:#C6D9F1;border:none;mso-border-top-alt:solid windowtext .5pt; padding:0cm;mso-padding-alt:1.0pt 0cm 0cm 0cm"><b><span lang="EN-GB" style="color:black;mso-ansi-language:EN-GB;layout-grid-mode: line">Aacadamic History</span></b></p> </div> <p class="MsoNormal" style="text-align:justify;text-justify:inter-ideograph; text-indent:36.0pt;line-height:18.0pt;mso-line-height-rule:exactly"><span lang="EN-GB" style="mso-fareast-font-family:;color:black;mso-ansi-language: EN-GB;mso-fareast-language:ZH-CN;layout-grid-mode:line">Gr.12<o:p></o:p></span></p> <p class="MsoNormal" style="text-align:justify;text-justify:inter-ideograph; line-height:18.0pt;mso-line-height-rule:exactly"><span lang="EN-GB" style="mso-fareast-font-family:;color:black;mso-ansi-language:EN-GB; mso-fareast-language:ZH-CN;layout-grid-mode:line">Physics SPH4U1 99%<o:p></o:p></span></p> <p class="MsoNormal" style="text-align:justify;text-justify:inter-ideograph; line-height:18.0pt;mso-line-height-rule:exactly"><span lang="EN-GB" style="mso-fareast-font-family:;color:black;mso-ansi-language:EN-GB; mso-fareast-language:ZH-CN;layout-grid-mode:line">Calculus and Vectors MCV4U1 97%<o:p></o:p></span></p> <p class="MsoNormal" style="text-align:justify;text-justify:inter-ideograph; line-height:18.0pt;mso-line-height-rule:exactly"><span lang="EN-GB" style="mso-fareast-font-family:;color:black;mso-ansi-language:EN-GB; mso-fareast-language:ZH-CN;layout-grid-mode:line">Advanced Functions MHF4U1 93%<o:p></o:p></span></p> <p class="MsoNormal" style="text-align:justify;text-justify:inter-ideograph; line-height:18.0pt;mso-line-height-rule:exactly"><span lang="EN-GB"