istry SCH3U1 95%<o:p></o:p></span></p> <p class="MsoNormal" style="text-align:justify;text-justify:inter-ideograph; line-height:18.0pt;mso-line-height-rule:exactly"><span lang="EN-GB" style="mso-fareast-font-family:;color:black;mso-ansi-language:EN-GB; mso-fareast-language:ZH-CN;layout-grid-mode:line">Functions MCR3U1 99%<o:p></o:p></span></p> <p class="MsoNormal" style="text-align:justify;text-justify:inter-ideograph; line-height:18.0pt;mso-line-height-rule:exactly"><span lang="EN-GB" style="mso-fareast-font-family:;color:black;mso-ansi-language:EN-GB; mso-fareast-language:ZH-CN;layout-grid-mode:line">Biology SBI3U1 93%<o:p></o:p></span></p> <p class="MsoNormal" style="text-align:justify;text-justify:inter-ideograph; line-height:18.0pt;mso-line-height-rule:exactly"><span lang="EN-GB" style="mso-fareast-font-family:;color:black;mso-ansi-language:EN-GB; mso-fareast-language:ZH-CN;layout-grid-mode:line">Communication Technology TGI3M1 93%<o:p></o:p></span></p> <p class="MsoNormal" style="text-align:justify;text-justify:inter-ideograph; line-height:18.0pt;mso-line-height-rule:exactly"><span lang="EN-GB" style="mso-fareast-font-family:;color:black;mso-ansi-language:EN-GB; mso-fareast-language:ZH-CN;layout-grid-mode:line"><o:p>&nbsp;</o:p></span></p> <p class="MsoNormal" style="text-align:justify;text-justify:inter-ideograph; line-height:18.0pt;mso-line-height-rule:exactly"><b><span lang="EN-GB" style="mso-fareast-font-family:;color:black; mso-ansi-language:EN-GB;mso-fareast-language:ZH-CN;layout-grid-mode:line">University of Toronto</span></b><span lang="EN-GB" style="color:black;mso-ansi-language: EN-GB;layout-grid-mode:line"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span>&nbsp;</span></span><span lang="EN-GB" style="mso-fareast-font-family: ;color:black;mso-ansi-language:EN-GB;mso-fareast-language:ZH-CN;layout-grid-mode: line"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span lang="EN-GB" style="color:black;mso-ansi-language:EN-GB;layout-grid-mode:line"><span>&nbsp;</span></span><span lang="EN-GB" style="mso-fareast-font-family: ;color:black;mso-ansi-language:EN-GB;mso-fareast-language:ZH-CN;layout-grid-mode: line"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><b>2011- 2015<o:p></o:p></b></span></p> <p class="MsoNormal" style="text-align:justify;text-justify:inter-ideograph; line-height:18.0pt;mso-line-height-rule:exactly"><span lang="EN-GB" style="mso-fareast-font-family:;color:black;mso-ansi-language:EN-GB; mso-fareast-language:ZH-CN;layout-grid-mode:line">Physics Specialist<o:p></o:p></span></p> <p class="MsoNormal" style="text-align:justify;text-justify:inter-ideograph; line-height:18.0pt;mso-line-height-rule:exactly"><span lang="EN-GB" style="mso-fareast-font-family:;color:black;mso-ansi-language:EN-GB; mso-fareast-language:ZH-CN;layout-grid-mode:line"><o:p>&nbsp;</o:p></span></p> <p class="MsoNormal" style="margin-left:35.7pt;text-align:justify;text-justify: inter-ideograph;line-height:150%"><span lang="EN-GB" style="mso-fareast-font-family: ;color:black;mso-ansi-language:EN-GB;mso-fareast-language:ZH-CN;layout-grid-mode: line">1<sup>st</sup> Year Courses<o:p></o:p></span></p> <p class="MsoNormal" style="text-align:justify;text-justify:inter-ideograph; line-height:150%"><span lang="EN-GB" style="mso-fareast-font-family:; color:black;mso-ansi-language:EN-GB;mso-fareast-language:ZH-CN;layout-grid-mode: line">PHY151H1/152H2 Foundations of Physics<o:p></o:p></span></p> <p class="MsoNormal" style="text-align:justify;text-justify:inter-ideograph; line-height:150%"><span lang="EN-GB" style="mso-fareast-font-family:; color:black;mso-ansi-language:EN-GB;mso-fareast-language:ZH-CN;layout-grid-mode: line">PHY189H1 Physics at the Cutting Edge<o:p></o:p></span></p> <p class="MsoNormal" style="text-align:justify;text-justify:inter-ideograph; line-height:150%"><span lang="EN-GB" style="mso-fareast-font-family:; color:black;mso-ansi-language:EN-GB;mso-fareast-language:ZH-CN;layout-grid-mode: line">CHM151Y1 Chemistry: The Molecular Science<o:p></o:p></span></p> <p class="MsoNormal" style="text-align:justify;text-justify:inter-ideograph; line-height:150%"><span lang="EN-GB" style="mso-fareast-font-family:; color:black;mso-ansi-language:EN-GB;mso-fareast-language:ZH-CN;layout-grid-mode: line">MAT137Y1 Calculus<o:p></o:p></span></p> <p class="MsoNormal" style="text-align:justify;text-justify:inter-ideograph; line-height:150%"><span lang="EN-GB" style="mso-fareast-font-family:; color:black;mso-ansi-language:EN-GB;mso-fareast-language:ZH-CN;layout-grid-mode: line">PMU199Y1 Lec 0291 Mathematics in Current Events<o:p></o:p></span></p> <p class="MsoNormal" style="text-align:justify;text-justify:inter-ideograph; line-height:150%"><span lang="EN-GB" style="mso-fareast-font-family:; color:black;mso-ansi-language:EN-GB;mso-fareast-language:ZH-CN;layout-grid-mode: line">HPS100H1<span>&nbsp; </span>Intro to History and Philosophy of Science<o:p></o:p></span></p> <p class="MsoNormal" style="text-align:justify;text-justify:inter-ideograph; line-height:150%"><span lang="EN-GB" style="mso-fareast-font-family:; color:black;mso-ansi-language:EN-GB;mso-fareast-language:ZH-CN;layout-grid-mode: line"><o:p>&nbsp;</o:p></span></p>'),
(34, 1907, '<p>I love teaching.&nbsp;&nbsp;Nothing gives me more satisfaction than explaining an idea, a thought, a concept, or a notion to another person. &nbsp;Coupled with my passion for mathematics, I&nbsp;have the solid foundation necessary to aid students in grasping tricky concepts.</p><p>&nbsp;</p><p>If I''m online, feel free to connect with me and ask me a question, if not, leave a message and I''ll get back to you as soon as I&nbsp;can!</p>'),
(35, 2004, '<p>Wide and deep knowledge of Physics and Math, able to simplify and make fundamental concepts seem intuitive. Experienced teaching programming and swimming lessons. Try me; it is very likely I can help you!</p><p>&nbsp;</p>'),
(36, 2021, '<p>Hello! My name''s Stephen. Though I''m only a first-year student, I have  excelled in mathematics throughout highschool and currently have 98% in  MAT133. I have done a lot of informal tutoring in the past, and feel  that I am relatively good at helping people understand concepts.&nbsp;Please  contact me if you would like my help!</p>'),
(37, 2003, '<p>&nbsp;I have participated in several math contests along with recreational tutoring events in high school. Currently, I have a GDP of 4.0 in MATA 32 (cal. for managment). I feel that I have a proficient background in teaching vague mathematical concept b/c throughout high school I have acheived 90+ averages. So feel free to ask any questions!!<img alt="" src="http://www.rayku.com/js/fckeditor/editor/images/smiley/msn/cold.gif" /><img alt="" src="http://www.rayku.com/js/fckeditor/editor/images/smiley/msn/furious.gif" /><img alt="" src="http://www.rayku.com/js/fckeditor/editor/images/smiley/msn/wavespin.gif" /></p>'),
(38, 1698, '<p>Astronomy/Astrophysics/Economics Major @ UofToronto</p><p>First Year Math/First Year Physics.</p>'),
(39, 1676, '<p><span style="color: rgb(87, 87, 87); font-family: Arial; font-size: 14px; line-height: 20px; text-align: left; ">Welcome to my portfolio profile. I am a new expert at Rayku so you may not be able to see much on this page. I can help you out with undergrad or high school math. Just shoot me a question if I''m online, or send me a message on my Gmail.</span></p>'),
(40, 2111, '<p>&nbsp;Hey guys!</p> <p>I am in my final year of double major in Actuarial Sciences and Economics.I have been tutoring first and second year students for mathematics and actuarial courses in the past.Feel free to ask me any question regarding my field and i will try to help you in the best way I can.<img alt="" src="http://www.rayku.com/js/fckeditor/editor/images/smiley/msn/smug.png" /></p>'),
(41, 2020, '<p><em>&nbsp;Here''s a copy and paste of my profile blurb, which doubles as a promotional description!&nbsp;</em></p><p>Hey there, thanks for reading my profile, I guess! I''m a new tutor at rayku, but I''ve had past tutoring experience at Kumon. I go to UofT St.George for lifesci, and I''m currently a freshman.</p><p>Don''t think that makes me less knowledgeable though, I still probably remember the curriculum for first year calc better than a fourth-year!</p><p>You can ask me about first year calc, or high school adv. funcs/calc, as well as AP calc.&nbsp;</p>'),
(42, 2201, '<p>&nbsp;I add value by answering any design questions that you may have. I have a Masters in Architecture and have 13 plus years of design experience. But most importantly im here to listen and learn from you! Give me a shout! And check out some of my work at www.joyhound.com.&nbsp;</p>');
