(623, 1697, 274, '2012-02-24 20:06:57', '2012-02-25 01:26:52', '<p>&nbsp;Already in the works! Though we are currently experiencing technical issues with several of our notification channels, our current system still makes it possible &nbsp;to receive notifications on your smartphones. If you have a Facebook or a Gmail application on your phone, you will be able to receive notifications if you have&nbsp;activated&nbsp;our Facebook or Gtalk notification features. &nbsp;</p>', 1, 0, '141.117.166.89', 0, NULL),
(622, 1697, 268, '2012-02-24 19:58:42', '2012-02-24 19:58:42', '<p>In response to both Dim and Lukas: we''ve considered branching into other subjects, particularly science, for quite some time now. However, we felt we should proceed one step at a time to ensure our entire platform and the current whiteboard in its most basic form is stable and functional. We''ve envisioned tailoring several variations of the whiteboard with tools specific to each field. The next phase of whiteboards would certainly take into account many of the elements Minhal has kindly mentioned.&nbsp;</p><p>We appreciate all the suggestions guys! Keep them coming!&nbsp;</p>', 0, 0, '141.117.166.89', 0, NULL),
(620, 2051, 291, '2012-02-24 18:15:03', '2012-02-24 18:15:03', '<p>Hi there,<br /><br />This is just to inform everyone that our tutor notifications for the desktop application, Google Talk, and Facebook Chat bots are currently down. <br /><br />We are working on this, and will update this thread with updates.<br /><br />The web notifications continue to function.<br /><br />Thanks!<br />Donny &amp; Rayku Dev Team</p>', 0, 0, NULL, 0, NULL),
(621, 124, 292, '2012-02-24 18:16:24', '2012-02-24 18:17:53', '<p>Hi there,<br /><br />This is just to inform everyone that our tutor  notifications for the <strong>desktop application, Google Talk, and Facebook  Chat bots</strong> has been and is currently down. You will not receive notifications for questions through these mediums.<br /><br />We are working on this, and will update this thread with updates.<br /><br />The web notifications continue to function.<br /><br />Thanks!<br />Rayku Dev Team</p>', 0, 0, NULL, 0, NULL),
(618, 2041, 290, '2012-02-24 10:50:17', '2012-02-24 10:50:17', '<p>&nbsp;Hello!</p><p>My name is Julia Toadere and I am a sophmore (second year) student at Uoft studying Rotman Commerce. Nice to meet you all!</p>', 0, 0, NULL, 0, NULL),
