(617, 1608, 289, '2012-02-24 08:53:45', '2012-02-24 08:53:45', '<div id="add-value" style="font-size: 10px; margin-top: 0px; margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 20px; padding-left: 0px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 4px; border-left-width: 0px; border-style: initial; border-color: initial; outline-width: 0px; outline-style: initial; outline-color: initial; vertical-align: baseline; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: transparent; color: rgb(87, 87, 87); border-bottom-style: solid; border-bottom-color: rgb(234, 234, 234); font-family: Arial; line-height: 10px; "> <p style="font-size: 14px; margin-top: 20px; margin-right: 0px; margin-bottom: 5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; outline-width: 0px; outline-style: initial; outline-color: initial; vertical-align: baseline; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: transparent; line-height: 20px; border-style: initial; border-color: initial; color: rgb(87, 87, 87); font-family: Arial; background-position: initial initial; background-repeat: initial initial; ">My name is Fatima and&nbsp;I am a Sophomore, University of Toronto, student with expertise in<strong style="font-size: 14px; margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; outline-width: 0px; outline-style: initial; outline-c