dding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; outline-width: 0px; outline-style: initial; outline-color: initial; vertical-align: baseline; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: transparent; background-position: initial initial; background-repeat: initial initial; ">&nbsp;</div> <div style="font-size: 10px; margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; outline-width: 0px; outline-style: initial; outline-color: initial; vertical-align: baseline; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: transparent; background-position: initial initial; background-repeat: initial initial; "><u style="font-size: 10px; margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; outline-width: 0px; outline-style: initial; outline-color: initial; vertical-align: baseline; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: transparent; background-position: initial initial; background-repeat: initial initial; "><em style="font-size: 10px; margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; outline-width: 0px; outline-style: initial; outline-color: initial; vertical-align: baseline; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: transparent; font-style: italic; font-weight: normal; background-position: initial initial; background-repeat: initial initial; ">Also I do have an experience of teaching in Mathematical field to O-levels and A-levels...and I am gold medalist in this field.</em></u> <p style="font-size: 14px; margin-top: 20px; margin-right: 0px; margin-bottom: 5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; outline-width: 0px; outline-style: initial; outline-color: initial; vertical-align: baseline; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: transparent; line-height: 20px; border-style: initial; border-color: initial; background-position: initial initial; background-repeat: initial initial; ">If I''m online, connect with me! If not, feel free to leave me a message and I''ll get back to you asap.</p> <div>&nbsp;</div> </div> </div> <div id="followers" style="font-size: 10px; margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; outline-width: 0px; outline-style: initial; outline-color: initial; vertical-align: baseline; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: transparent; color: rgb(5, 106, 154); font-family: Arial; line-height: 10px; ">&nbsp;</div>', 0, 0, NULL, 0, NULL),
(615, 2004, 208, '2012-02-23 22:09:57', '2012-02-23 22:09:57', '<p>I am from Queen''s Bsc and ISU Msc, waiting to see where I''ll go next!&nbsp;</p>', 0, 0, '69.157.44.244', 0, NULL),
(616, 2027, 288, '2012-02-23 23:57:09', '2012-02-23 23:57:09', '<p>Hey everyone,</p><p>My name is Jeremy Huang. I am in the Life Sciences program and plan to specialize in Neuroscience at the UofT - St. George campus.</p><p>I have a passion for math and teaching that passion is a pleasure. I''ve had plenty of experience tutoring peers math from elementary school to high school. I even joined the math tutoring team during my years in high school.&nbsp;</p><p>I can cover material in MAT135, MAT136, high school advanced functions, high school calculus.&nbsp;</p><p>Feel free to ask questions! I look forward to helping.</p>', 0, 0, NULL, 0, NULL),
(613, 2023, 286, '2012-02-23 21:31:05', '2012-02-23 21:31:28', '<p>&nbsp;Hello!</p> <p>My name is Michelle</p> <p>I am a high school teacher for the Toronto District School Board, currently teaching Grade 9 - Grade 12 Mathematics. &nbsp;I also have various experiences teaching eLearning courses.&nbsp;</p> <p>I have an undergraduate degree in applied math and a masters degree in mathematics and statistics.</p> <p>&nbsp;</p>', 0, 0, NULL, 0, NULL),
(614, 1953, 287, '2012-02-23 21:38:03', '2012-02-23 21:38:03', '<p>Post all general suggestions for improvement here<br /> <br /> It will make the site cleaner and the dev team can just look here to review the many suggestions everyone may have.<br /> <br /> The only original suggest I have brought forth so far has been for an iPhone app, and apps for other smart phones.<br /> &nbsp;</p>', 0, 0, NULL, 0, NULL),
(610, 2015, 231, '2012-02-23 18:15:26', '2012-02-23 18:15:26', '<p>&nbsp;University Graduate in electrical engineering</p> <p>&nbsp;</p> <div id="myEventWatcherDiv" style="display:none;">&nbsp;</div>', 0, 0, '64.56.226.152', 0, NULL),
(611, 2020, 284, '2012-02-23 19:15:52', '2012-02-23 19:15:52', '<p>&nbsp;Hey everyone, I just registered to be a tutor on Rayku! I''m a freshman at UofT, and I can cover first year math and high school math pretty well.&nbsp;The whiteboard looks fun to use, and I hope I''m able to be a good tutor for you guys.&nbsp;</p><p>I can cover MAT135 and MAT136 topics, as well as 12U and 12AP (Advanced Functions, Calculus &amp; Vectors).</p><p>I''ve got a few years experience of tutoring at Kumon, too, and have completed F-O levels of Kumon Math myself.&nbsp;</p><p>Feel free to ask me questions!&nbsp;</p><p>Welcome to everyone else, too, since Rayku is new and everything!&nbsp;</p><p>&nbsp;</p>', 0, 0, NULL, 0, NULL),
(612, 2021, 285, '2012-02-23 19:30:32', '2012-02-23 19:30:32', '<p>When prompted with what areas of math I would be comfortable teaching, I wasn''t sure whether to include advanced math. Could somebody explain what &quot;advanced math&quot; encompasses?<br />&nbsp;</p><p>Thanks in advance.</p><p>-Stephen</p>', 0, 0, NULL, 0, NULL),
(609, 1907, 283, '2012-02-23 16:57:54', '2012-02-23 16:57:54', '<p>Hey everyone,</p><p>I''m Minhal, I''m a second year student doing a specialist in Chemistry, and a specialist in Physics at UofT, and trying to squeeze a Math minor in there.&nbsp;&nbsp;If you''re at the St. George campus, you can usually catch me at Lash Miller or McLennan.</p><p>I love teaching, and I&nbsp;have been tutoring privately for about 2 years.&nbsp;&nbsp;As far as my abilities are concerned, I&nbsp;can tutor any first year math course&nbsp;(MAT133/135/136/137/223/224) and some second year courses (MAT235/244).&nbsp;&nbsp;If you have questions from other areas, I welcome those too!&nbsp;My passion lies in Chemistry and Physics, so feel free to ask questions from those subjects as well.&nbsp;&nbsp;To be specific:&nbsp;PHY131/132/151/152, CHM138/139/151/217/238/247/249)</p><p>&nbsp;</p><p>Hope I''ll see you around!</p><p>-M.</p>', 0, 0, NULL, 0, NULL),
(602, 1938, 277, '2012-02-22 22:58:26', '2012-02-22 22:58:26', '<p>&nbsp;Hi Joni,&nbsp;</p><p>Nice to meet you.&nbsp;<img alt="" src="http://www.rayku.com/js/fckeditor/editor/images/smiley/msn/smile.png" /></p>', 0, 0, '99.243.240.122', 0, NULL),
(603, 1637, 279, '2012-02-23 02:23:00', '2012-02-23 02:23:00', '<p>Hi!</p><p>My name is Derek and I''m a Commerce student at the University of Toronto. My specialist is Finance, and I am excited to be working with all of you!</p><p>Please feel free to ask me any questions.</p><p>Derek</p>', 0, 0, NULL, 0, NULL),
(604, 1952, 275, '2012-02-23 13:19:46', '2012-02-23 13:19:46', '<p>ya sure let me know when you are available</p>', 0, 0, '142.1.160.148', 0, NULL),
(605, 1952, 275, '2012-02-23 13:20:12', '2012-02-23 13:20:12', '<p>oh and make sure to tell me which subject you want to get tutored</p>', 0, 0, '142.1.160.148', 0, NULL),
(606, 1958, 280, '2012-02-23 14:12:10', '2012-02-23 14:12:10', '<p>All of the tutors here should invite all of the students they tutored before who are going into more math and science courses. Also tell them to invite their friends and to ask questions when ever they need to!</p>', 0, 0, NULL, 0, NULL),
(607, 1619, 281, '2012-02-23 15:07:18', '2012-02-23 15:07:18', '<p>Since we just opened up Rayku, there are definitely a lot of areas for improvement.</p><p>Our dev team is working overtime to improve the site and its functionalities! We''re aiming for daily iterations so that we can continuously move towards a more solid platform.</p><p>&nbsp;</p><p>Please continue to give us your suggestions relating to the whiteboard, platform, and anything else that you see can help us improve. It really helps.</p><p>Thanks!</p>', 0, 0, NULL, 0, NULL),
(608, 1619, 282, '2012-02-23 15:08:40', '2012-02-23 15:08:40', '<div class="message"><p>Since we just opened up Rayku, there are definitely a lot of areas for improvement.</p><p>Our  dev team is working overtime to improve the site and its  functionalities! We''re aiming for daily iterations so that we can  continuously move towards a more solid platform.</p><p>&nbsp;</p><p>Please  continue to give us your suggestions relating to the whiteboard,  platform, and anything else that you see can help us improve. It really  helps.</p><p>Thanks!</p></div>', 0, 0, NULL, 0, NULL),
(599, 1671, 231, '2012-02-22 21:55:50', '2012-02-22 21:55:50', '<p>Also at Rotman Commerce but for Accounting instead.</p>', 0, 0, '184.175.8.21', 0, NULL),
(600, 1671, 277, '2012-02-22 22:01:33', '2012-02-22 22:01:33', '<p>Hello to every one reading,</p><p>My name is Joni and I am currently studying at University of Toronto. Currently in my undergraduate degree studying for an Accounting Specailist at Rotman&nbsp;Commerce.&nbsp; </p><p>I''ve been tutoring students and peers of all ages from elementary school to high school level in Math over the past couple years.&nbsp; </p><p>Feel free to ask me questions!&nbsp; I look forward to working and meeting all of you.</p>', 0, 0, NULL, 0, NULL),
(601, 1938, 278, '2012-02-22 22:56:39', '2012-02-22 22:56:39', '<p>&nbsp;<img alt="\\&quot;\\&quot;" src="\\&quot;http://www.rayku.com/js/fckeditor/editor/images/smiley/msn/wavespin.gif\\&quot;" />Hi all,&nbsp;</p><p>My name is Vicky. I am student from University of Toronto.&nbsp;</p><p>Although I am not really in any science major or math major, many of us know that most of our courses require some math background and foundation. :P &nbsp;</p><p>I have been tutoring in my past years and I also been to different high school for volunteer and helping student &nbsp;in math.&nbsp;</p><p>I am not a math major but i am sure with my experience and math background, I can help with any high school math.&nbsp;</p><p>So.... ask if you need help :D and hope to see you guys laterrrrr~~&nbsp;</p><p>&nbsp;</p>', 0, 0, NULL, 0, NULL),
(595, 1958, 231, '2012-02-22 19:53:05', '2012-02-22 19:53:05', '<p>Majoring in physics and mathematics at U of T</p>', 0, 0, '24.150.215.85', 0, NULL),
(596, 1958, 208, '2012-02-22 19:54:07', '2012-02-22 19:54:07', '<p>Missisauaga campus wooo, nat</p>', 0, 0, '24.150.215.85', 0, NULL),
(597, 1958, 274, '2012-02-22 19:54:42', '2012-02-22 19:54:42', '<p>Would be awesome!</p>', 0, 0, '24.150.215.85', 0, NULL),
(598, 1907, 268, '2012-02-22 21:18:10', '2012-02-22 21:18:10', '<p>Undoubtedly, a table of constants pertaining to each discipline would be of great assistance.&nbsp;&nbsp;Additionally, certain fundamental formula should be added so that they need not be typed or written.&nbsp;&nbsp;For example, the volume of a sphere, or the area of a circle.</p><p>In addition, perhaps basic proofs of concepts can be added, or be readily available to a student when they sign up.&nbsp;&nbsp;Often, the proof of a formula provides a solid foundation for understanding the concept, and at the very least can help a struggling student develop a sense of intuition towards an idea.<br /><br />Given that the majority of students will be learning introductory Calculus and Linear Algebra, having access to proofs of frequently used concepts will be paramount.&nbsp;&nbsp;Undoubtedly, proofs can be lengthy, so having them available separately, in an easy-to-understand format could attract many more clients.<br />Finally, this may not be appropriate for the initial stages of the site, however; providing students with some sort of exercise or &quot;problem set&quot; to complete may be highly beneficial.&nbsp;&nbsp;They do have their other formal academic studies to attend to, but surely a truly motivated student would not mind doing 10 extra problems to fully grasp the concept they are struggling with.</p><p>-M.</p>', 0, 0, '108.162.185.168', 0, NULL),
