(263, 1471, 115, '2011-02-15 10:56:23', '2011-02-15 10:56:23', '<p>Welcome to Rayku Gary!!</p>\r\n<p>phadkekaran, I&nbsp;moved your question to the new Rayku Help forum where I''ll answer it:<br />\r\n<a href="http://www.rayku.com/forum/thread/116/1">http://www.rayku.com/forum/thread/116/1</a></p>\r\n<p>Thanks!<br />\r\nDonny<br />\r\n&nbsp;</p>', 0, 0, NULL, 0, NULL),
(264, 1471, 116, '2011-02-15 11:02:15', '2011-02-15 11:07:17', '<p>Good question.</p>\r\n<p><strong>Rayku Points, or RP</strong>, are basically the currency used at Rayku.com.</p>\r\n<p>&nbsp;</p>\r\n<p>Right now 1RP equals 1 Canadian Dollar.</p>\r\n<p>&nbsp;</p>\r\n<p>Ways to spend Rayku Points (RP):</p>\r\n<ul>\r\n    <li>Buy anything from the <a href="http://www.rayku.com/shop">Rayku Shop</a></li>\r\n    <li>Ask for <a href="http://www.rayku.com/dashboard">live expert help</a> (you pay an RP amout per minute)</li>\r\n</ul>\r\n<p>Ways to get more Rayku Points:</p>\r\n<ul>\r\n    <li><a href="http://www.rayku.com/register/invitation">Invite your friends</a> to Rayku</li>\r\n    <li>Help other people with live expert help (keep your window open and you will be alerted with a question soon.</li>\r\n    <li>Answering questions on the boards (here) in the academic forums, and get selected as ''best answer''.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Hope that helps!<br />\r\nDonny</p>', 1, 0, NULL, 0, NULL),
