(591, 1952, 275, '2012-02-22 19:19:46', '2012-02-22 19:19:46', '<p>My name is Changho,</p><p>and I am a sophromore in UofT SG for Math specialist!</p><p>I took MAT157, MAT240, MAT247, MAT267 and MAT309,</p><p>and currently taking MAT257, MAT347, MAT357, MAT363 and APM461.</p><p>If you have any questions about the ones I&nbsp;took (and the similar ones), I can kindly answer them.</p><p>(For example, 133/135/137/157, 223/240, 224/247, 244/267, 309)</p><p>I can answer partly to anything I am taking right now (or relevant ones)</p><p>(like 235/237/257, 301/347, 337/357, 363, APM461).</p><p>Feel free to ask me!</p><p>PS: I have 2 years of experience in tutoring, so I&nbsp;am confident about my skills.</p>', 0, 0, NULL, 0, NULL),
(592, 1958, 276, '2012-02-22 19:29:32', '2012-02-22 19:29:32', '<p>Hello everyone! My name is Paul Devenish and I am a student at the University of Toronto. I am currently pursuing a honors bachelors degree in mathematics and physics. I also privately tutor grade 9-12 students in mathematics and physics. I like to help and I like a challenge. Ask me a question if you''ve got one.</p>', 0, 0, NULL, 0, NULL),
