(579, 1663, 269, '2012-02-22 11:12:00', '2012-02-22 11:12:00', '<p>Hey! Everyone, I am MAT137MAN, welcome to ask me any questions related to mat137 and other materials related to math. I am glad to help you !!! <img src="http://www.rayku.com/js/fckeditor/editor/images/smiley/msn/wink.png" alt="" /></p>', 0, 0, NULL, 0, NULL),
(578, 1923, 268, '2012-02-22 00:25:24', '2012-02-22 00:25:24', '<p>There seem to be many science students here (like me), so I think it would make sense to encourage some science questions and add some relevent functions to the whiteboard. </p><p>Examples:</p><p>For Physics: Definately add constants and some of the common symbols. Copying masteringphysics'' tools (which I''m sure most people here have used) wouldn''t be a bad idea. </p><p>For Chemistry: Add chemistry constants, and accessible periodic table, charts of half cell reactions, weak acid/base K values, and the like. </p><p>For Biology: There isn''t much required to teach biology. The video and audio chats will be the most useful features. Maybe an MSN like IM function on the whiteboard will help. </p><p>Of course, the site will need time to start up first and gain popularity, but in the meanwhile, its good to have a brainstorm of ideas for expansion. I know alot of people struggle with the sciences (especially physics), so this will open up a huge client base. </p>', 0, 0, NULL, 0, NULL),
(577, 1923, 245, '2012-02-22 00:16:20', '2012-02-22 00:16:20', '<p>Step 1. Go on Google and find pic of Calculon. Suggestion:</p><p>http://images.wikia.com/en.futurama/images/b/b3/Calculon-2.JPG</p><p>Step 2. Save onto your computer.</p><p>Step 3. Go to Edit Profile under the arrow menu on your name &quot;top right corner&quot;.</p><p>Step 4. Upload the pic using the very first option you see.</p><p>Step 5. En-ALL&nbsp;GLORY&nbsp;TO&nbsp;THE&nbsp;HYPNOTOAD</p>', 0, 0, '71.226.121.39', 0, NULL),
