(466, 1619, 210, '2011-10-09 17:48:28', '2011-10-09 17:48:28', '<p>Hey guys,</p><p>First of all, welcome to&nbsp;the Rayku beta! You''re the first to be able to take a peak inside, and we''re glad to have you here.</p><p>Please take some time now to try out the website, introduce yourself, and get to know one another.</p><p>In the coming weeks, we will be accepting a limited amount of invite-only students who would come onto the site to ask math-related questions. This will be a mix of first-year university students, and high school students.</p><p>Good luck! If you haven''t already, make sure to try out the whiteboard application by yourself at:<br /><a href="http://whiteboard.rayku.com">http://whiteboard.rayku.com</a></p><p>We''ll be sending you more stuff over email (i.e. training package) over the coming weeks to help you with getting prepared.<br />&nbsp;</p><p>If you have any questions or suggestions, post them in this forum.</p><p>Thanks!<br />Donny</p>', 0, 0, NULL, 0, NULL),
