(574, 1917, 266, '2012-02-21 20:59:07', '2012-02-21 20:59:07', '<p>&nbsp;Hello,</p><p>I''m Crystal from the University of Toronto St.George campus. I''m a first year life science student. I have prior experience in math tutoring, and I look forward to tutoring on whiteboard which is a new experience for me!!</p>', 0, 0, NULL, 0, NULL),
(624, 1697, 285, '2012-02-24 20:58:24', '2012-02-24 20:58:24', '<p>&nbsp;Hi there,</p><p>It has recently come to our attention that the field in question is not specific enough for our purposes and so we are working to remove it. So in the meantime, please ignore it as an option. We apologize for the confusion!&nbsp;</p>', 0, 0, '141.117.166.89', 0, NULL),
(625, 1980, 293, '2012-02-25 01:08:56', '2012-02-25 01:08:56', '<p>This here is Dariush, clockin'' in from the University of Toronto. You need math help?! Bitch, I got a 50 in calculus so gimme a question, and I''ll solve exactly half of it for you. That''s what we call a percentage, bitch.&nbsp;</p>', 0, 0, NULL, 0, NULL),
(626, 1980, 293, '2012-02-25 01:21:54', '2012-02-25 01:21:54', '<p>No seriously though, I can help out with any questions you have for the following courses at U of T St. George, or any similar course in another university;<br /><br />PHY151<br />PHY152<br />PHY252<br />MAT223<br />MAT137<br />AST121<br /><br />Essentially, I should be able to help you out with any first year math or physics.</p>', 0, 0, '24.246.88.121', 0, NULL),
(627, 1893, 285, '2012-02-25 02:16:00', '2012-02-25 02:16:00', '<p>&nbsp;I figured Advanced Mathematics referred to Real Analysis, Complex Analysis, PDEs, Partial Differential Operators, and Stochastic Calculus. These subjects most certainly qualify as advanced relative to the rest of the options&nbsp;on the list.</p>', 0, 0, '174.118.234.177', 0, NULL),
