(650, 1671, 287, '2012-02-25 16:22:26', '2012-02-25 16:22:26', '<p>I noticed that the desktop application only is made for the Mac OS and it''d be nice ot have a version that is compatible with Windows too.&nbsp; And originally, was there the idea of connecting to Rayku via MSN messenger?&nbsp; I somewhat remember it being mentioned but not really sure.</p><p>I personally don''t use facebook much and having to be logged onto the website in a separate window where I can see it can be a hassle sometimes.</p><p>Anyways, great job in setting up a &quot;General Suggestions Thread&quot;.&nbsp; Makes it more organized in my opinion ;D</p>', 0, 0, '99.237.226.89', 0, NULL),
