(667, 2166, 298, '2012-03-02 00:20:27', '2012-03-02 00:20:27', '<p>&nbsp;Find a degree 4 polynomial f(x) with zeros at x = -1,2,4 and x = 7 that satisfies f(1) = -168</p>', 0, 0, NULL, 0, NULL),
(668, 2177, 299, '2012-03-02 00:47:49', '2012-03-02 00:47:49', '<p>&nbsp;a homework question that im not really understanding. help please!</p>', 0, 0, NULL, 0, NULL),
(669, 1980, 298, '2012-03-02 02:01:24', '2012-03-02 02:01:24', '<p>Hey there Arianna.<br /><br />What you want to do here first start by finding a polynomial that satisfies the roots, then go on to making it satisfy the condition at x=1.<br /><br />When you want to find a polynomials zeros, you factor until it is in a form that provides you with the zeros, or use the quadratic formula. Knowing this, we start from this point and work backwards.<br /><br />We want zeros at x=-1,2,4,7 so<br /><br />f(x) = (x+1)(x-2)(x-4)(x-7) &nbsp;has zeros at those values and is a 4th degree polynomial. (When expanded it becomes f(x) = x^4-12x^3+37x^2-6x-56)<br /><br />though this function has the zeros we require, when you calculate f(1), you''ll notice it is not -168. f(1)=-36<br />Now we need to find a constant to multiply the polynomial by in order to make f(1)=-168.<br /><br />So let''s divide -168 by -36.<br />-168/-36 = 4.66.... = 14/3<br /><br />So that is the value we multiply the polynomial by.<br /><br />f(x)=14/3(x^4-12x^3+37x^2-6x-56) is a 4th degree polynomial that satisfies your conditions.</p><p>&nbsp;</p>', 0, 0, '24.246.88.121', 0, NULL),
(670, 1980, 298, '2012-03-02 02:02:55', '2012-03-02 02:02:55', '<p>&nbsp;Please let me know if you need any more assistance, I''m more than happy to help!</p>', 0, 0, '24.246.88.121', 0, NULL),
(671, 1980, 299, '2012-03-02 03:14:55', '2012-03-02 03:14:55', '<p>Hi Sarah!<br /><br />The first thing we notice when looking at this question it is an equilateral triangle, which means all of the sides are equal.<br /><br />Given that, we only need to find the length of one side and we have them all!<br /><br />Alright so the altitude is the height of the triangle. In other words, it''s the line segment connecting the middle of a side to the opposite vertice. We''re given this value to be 8 units.<br /><br /><a href="http://i.imgur.com/iygm9.jpg">i.imgur.com/iygm9.jpg<br /></a>This is a sketch of the triangle so you can see where we are so far.<br /><br />Now we have essentially split the triangle into two right triangles.<br /><br />Since the lengths of each side are the same, we know that c=a=b. But for the two right triangles, c is split into two line segments, let''s call them c1, and c2. Where c1=c2=1/2a=1/2b<br /><br />Now all we do is use the pythagorean theorem. a^2 = 8^2+c^2 where c=1/2a so;</p><p>a^2-(a^2/4) = 8^2 &nbsp; &nbsp;(note: we it is now a^2/4 since you have to square both the a and the 1/2 in c=1/2a)<br /><br />Now we just re-arrange and solve for a.<br /><br />3a^2/4 = 8^2<br />a = (sqrt64)(sqrt4/3)<br />a=9.238</p><p>So the sidelength of a is 9.238 units. But since it''s equilateral, a=b=c so the all three sides are of length 9.238 units.<br />&nbsp;</p>', 0, 0, '24.246.88.121', 0, NULL),
(672, 1980, 299, '2012-03-02 03:15:09', '2012-03-02 03:15:09', '<p>&nbsp;Please let me know if you need anymore help! I''m more than happy to assist!</p>', 0, 0, '24.246.88.121', 0, NULL),
(673, 2191, 300, '2012-03-03 19:29:38', '2012-03-03 19:29:38', '<p>&nbsp;Hi everyone :)<br /><br />My name is Jennifer and I''m in first year Life Sciences at UofT.&nbsp;<br /><br />I''m currently taking first year calculus (MAT135/136), so if anyone has any questions, feel free to ask away! (After all, it''s still fresh in my mind, haha!). I have also taken Grade 12 Advanced Functions and Calculus.<br /><br />I have a passion for teaching and sharing knowledge. I have been a tutor since high school in various disciplines such as math, music and biology, and nothing makes my day more than seeing the light bulb go off in someone''s mind when they finally grasp a tough concept or tricky problem.<br /><br />:) Please don''t hesistate to ask me for help, or even just to chat!&nbsp;</p><p>I''m looking forward to getting to know everyone here on Rayku!</p>', 0, 0, NULL, 0, NULL),
(674, 2201, 301, '2012-03-04 20:22:25', '2012-03-04 20:22:25', '<p>Hi Im interested in offering design tutoring. I have a Masters in Architecture and 13 plus years experience in Art and Design. Is this a good environment for me to help?&nbsp;</p>', 0, 0, NULL, 0, NULL),
(675, 2201, 282, '2012-03-04 20:36:52', '2012-03-04 20:36:52', '<p>&nbsp;Saw you at Launchpad. My name is Koby Sackey, im working on a project here in New Orleans www.joyhound.com. Its in <a href="http://joyhound.tumblr.com/">development</a> now but will be live in May.&nbsp;</p><p>Anyway, keep up the good work. I left a suggestion after using your whiteboard. Everything pretty much looks good after that. One other thing I would consider is making the ''ask a question'' area more prominent somehow. Maybe a light light grey fill to the background rectangle.&nbsp;</p><p>Anyways, best of luck and will stay in touch! Your a great inspiration!!</p><p>&nbsp;</p><p>Koby S.</p>', 0, 0, '72.200.5.97', 0, NULL),
(676, 1958, 299, '2012-03-05 00:02:33', '2012-03-05 00:02:33', '<p>Also in the realm of trigonometry,</p><p>You could begin by using the implicated information</p><p>The triangle is equilateral so the angles in each corner are 60 degrees, the altitude is the height of the triangle connecting the base to the opposite vertex</p><p>we make a right angle triangle with the height and consider the hypoteneuse to be one side of the triangle</p><p>using sin law we can already calculate the side length!</p><p>sin90/(Hypoteneuse) = sin60/8</p><p>solve for the hypoteneuse and you are done</p><p>If you have further questions pleas ask me or Dariush</p>', 0, 0, '24.150.215.85', 0, NULL),
(677, 1958, 299, '2012-03-05 00:08:53', '2012-03-05 00:08:53', '<p>And with the knowledge that an equilateral triangle has equal side lengths, the hypoteneuse calculated has the same length as each side</p>', 0, 0, '24.150.215.85', 0, NULL),
(678, 2203, 302, '2012-03-06 09:01:30', '2012-03-06 09:01:30', '<p>Hi All</p><p>I am Nanthivarman an third year student at University of Toronto,&nbsp;Speciizing in Math and second teachable subject as Computer Science. I also finished my first degree in Electrical Engineering from State University of NewYork and have more than 10 years of experience teaching upto the second year Math courses and first year Phyiscs courses at any level. I have a great art of teaching skills, specially in Calculus I can make great impact in the understanding of the concepts, which defenetly make you feel very comfortable with that subject.So find me when ever I am online to get a great help and succeed in your Math and Physics courses. Good Luck</p><p>Best</p><p>Nanthi.J</p>', 0, 0, NULL, 0, NULL);
