(1596, 'Start tutoring at Rayku!', 'Hey Jeff Wu, welcome to Rayku.com!<br><br>Thanks for joining our community!<br><br>\n				 \n				 Before you get started, there are 3 important steps before you can start tutoring!<br><br>\n				 1) Make sure to have activated your tutor status by clicking ''on'' in your <a href="http://rayku.com/dashboard">dashboard page</a>.<br>\n				 2) Learn how to tutor effectively on Rayku in 5 minutes by watching our <a href="http://rayku.com/tutorshelp">tutor help videos</a>.<br>\n				 3) Lastly, make sure you are prepared to receive question notifications by connecting to <a href="http://rayku.com/dashboard/gtalk">google talk</a>, <a href="http://rayku.com/dashboard/facebook">facebook chat</a>, and <a href="http://notification-bot.rayku.com/download/rayku.dmg">MacOS</a> / <a href="http://notification-bot.rayku.com/download/rayku.exe">Windows</a> software.<br><br>\n				 \n				 Enjoy, and do let us know if you ever have any questions - we''re here to help!<br><br>\n				 				 \n				 Thanks!<br>\n				 Rayku Administration', 124, 1909, 0, 1, '2012-02-21 21:37:17', 0),
(1597, 'Re: Invalid Download Link', '<p>&nbsp;hey,&nbsp;</p> <p>&nbsp; I tried downloading the link for the notifications but when i tried to log in it says the creditentials dont match. &nbsp;How do i sign in?&nbsp;</p> <p>&nbsp;</p> <p>Maryann Fouad&nbsp;</p>', 1904, 124, 0, 1, '2012-02-21 21:42:39', 0),
(1598, 'Re: Re: Invalid Download Link', '<p>Hi Maryann,</p><p>You''re right, we were able to duplicate the issue. Hmm, very weird - our tech guy is looking into it right now and will hopefully get it resolved soon.</p><p>Thanks for letting us know.</p>', 124, 1904, 0, 1, '2012-02-21 21:47:35', 0),
(1599, 'Re: Invalid Download Link', '<p>&nbsp;Hello, I downloaded the desktop notification, but I don''t know how to login because it says that my credentials don''t match</p><p>&nbsp;</p><p>Crystal</p>', 1917, 124, 0, 1, '2012-02-21 21:50:02', 0),
(1600, 'listed as tutor', '<p>When can I expect to show up as a tutor on the tutors list? Thanks!&nbsp;</p>', 1922, 124, 0, 1, '2012-02-21 21:50:36', 0),
(1601, 'Re: Re: Invalid Download Link', '<p><div>Hi Crystal,<br /><br />You''re right, we were able to duplicate the issue. Hmm, very weird - our tech guy is looking into it right now and will hopefully get it resolved soon.<br /><br />Thanks for letting us know.</div></p>', 124, 1917, 0, 1, '2012-02-21 21:51:37', 0),
(1602, 'Re: listed as tutor', '<p>Hi Jacob,</p><p>You will already be able to show up on the tutor list when a student asks a question. On the general list at http://rayku.com/tutors, you''ll be up there by tonight. We''re still finishing up that page :).<br /><br />Thanks!</p>', 124, 1922, 0, 1, '2012-02-21 21:52:43', 0),
(1603, 'Re: Re: Re: Invalid Download Link', '<p>&nbsp;Hello,</p><p>so once the issue is solved, do I log in with the same email and password I use to log into this rayku account?</p><p>&nbsp;</p><p>Crystal.T</p>', 1917, 124, 0, 1, '2012-02-21 21:52:49', 0),
(1604, 'Re: Invalid Download Link', '<p>Yes, that''s right. I''ll send you a note once it''s been resolved.</p><p>Thanks!</p>', 124, 1917, 0, 1, '2012-02-21 21:53:49', 0),
(1605, 'Re: Re: listed as tutor', '<p>&nbsp;Sounds good, and things are looking like they are shaping up pretty well here. Found this site from a designer on Forrst.com. I''m also a designer and thought this was a cool idea since I happen to be a math teacher as well :)</p><p>&nbsp;</p><p>Looks like this is out of Canada eh? College students the developers?</p>', 1922, 124, 0, 1, '2012-02-21 21:56:05', 0),
(1606, 'Re: listed as tutor', '<p>Haha sounds great. Glad to have ya here.</p><p>Well as you can see, there''s still a bunch of work left to do. It''s going to be a gradual process as we fix all the inperfections here and there :).</p><p>There''s a lot happening in Canadian colleges!</p>', 124, 1922, 0, 1, '2012-02-21 22:01:10', 0),
(1607, 'dimitarkrastev has accepted your friend request!', 'You may manage your friend requests and friend requests sent to you here: <a href="/friends/members/username/rayku">Your friends page</a>', 1923, 124, 0, 0, '2012-02-21 22:22:48', 0),
(1608, 'Start tutoring at Rayku!', 'Hey Dimitar Krastev, welcome to Rayku.com!<br><br>Thanks for joining our community!<br><br>\n				 \n				 Before you get started, there are 3 important steps before you can start tutoring!<br><br>\n				 1) Make sure to have activated your tutor status by clicking ''on'' in your <a href="http://rayku.com/dashboard">dashboard page</a>.<br>\n				 2) Learn how to tutor effectively on Rayku in 5 minutes by watching our <a href="http://rayku.com/tutorshelp">tutor help videos</a>.<br>\n				 3) Lastly, make sure you are prepared to receive question notifications by connecting to <a href="http://rayku.com/dashboard/gtalk">google talk</a>, <a href="http://rayku.com/dashboard/facebook">facebook chat</a>, and <a href="http://notification-bot.rayku.com/download/rayku.dmg">MacOS</a> / <a href="http://notification-bot.rayku.com/download/rayku.exe">Windows</a> software.<br><br>\n				 \n				 Enjoy, and do let us know if you ever have any questions - we''re here to help!<br><br>\n				 				 \n				 Thanks!<br>\n				 Rayku Administration', 124, 1923, 0, 1, '2012-02-21 22:22:48', 0),
