(1786, 'Re: Recent Session', '<p>Ah I see, that''s interesting - we''ll definitely look into it!</p><p>Another question that I have is if you''ve missed any questions or clicked ''ignore'' for any questions that were sent to you.&nbsp;or have you not been receiving many questions from students?</p><p>If you have, what was the primary reason why you igored them? Is it because it was too difficult, or that you didn''t have the time, or that the countdown was too quick?</p><p>Thanks again for the insights. It''s actually really helpful :).</p><p>Donny</p>', 1619, 2004, 0, 1, '2012-02-23 18:45:53', 0),
(1787, 'Recent Missed Question', '<p>Hey Minhal</p><p>I just noticed that you had missed a question from a student, and was curious to hear what had happened so that we can improve Rayku based on that.</p><p>What was the primary reason why you igored it or allowed it to time out? Is it  because it was too difficult, or that you didn''t have the time, or that  the countdown was too quick?</p><p>Thanks again for the insights. It''s actually really helpful :).</p><p>Donny</p>', 1619, 1907, 0, 1, '2012-02-23 18:47:43', 0),
