(1811, 'indefinite integral of ln(x)', '<p>Hi Steven,</p><p>Sorry I left my laptop on and went out. </p><p>Ok to find integral of ln(x), which is f lnx dx: (cannot type the symbol integral, so I use f instead)</p><p>If you view lnx as 1 times lnx, it makes it easier. </p><p>Use by parts, set u = lnx, v '' = 1.</p><p>u '' = 1/x , v = x</p><p>Use integration by parts rule, f lnx dx = x*lnx - f x (1/x) dx</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; = x lnx - f 1 dx</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; = x lnx - x + C</p><p>Let me know if you get the problem. Sorry about the delay. If you have more problems, you can ask me again during the session where I can use the whiteboard.</p><p>&nbsp;</p><p>Thanks</p><p>Susan</p>', 1645, 2018, 0, 1, '2012-02-24 01:03:36', 0),
(1812, 'Re: Recent Missed Question', '<p>Hi Donny,</p><p>I opened the Rayku website since I do not want to miss any questions. But I left my laptop on and went out. Forgot about everything! </p><p>&nbsp;</p><p>I sent him the private message to explain the question. It is not hard. It ''s about finding the integral of lnx.</p><p>Thanks</p><p>Susan</p>', 1645, 1619, 0, 1, '2012-02-24 01:05:36', 0),
