(2227, 'Math Question', '<p>&nbsp;Hey omer !<br /><br />Sorry, I made a mistake in the question you asked me,<br /><br />f(5) = -17, so you do...<br />57 + 10m = -17<br />10m = -74<br />m = -74/10<br /><br />f(14) = 2(14)^2 + 2[-74/10](14) + 7<br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;= 2(196) - [148/10](14) + 7<br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;= 392 - [2072/10] + 7<br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;= 392 - &nbsp;207.2 + 7<br />f(14) = 191.8</p>', 1941, 2195, 0, 1, '2012-03-04 11:00:09', 0),
